function ExpenseItem() {
   return (
   <div className="expense-item">
      <div>09/18/2020</div>
         <div className="expense-item"><h2>Car Insurance</h2>
         <div>$50</div>
      </div>
   </div>
   );
}

export default ExpenseItem;
